Studio recordings compiled from 2004-2007 to serve as some sort of &quot;introduction&quot; or a &quot;greatest hits&quot; package from yours truly. Also included is the new song, &quot;Live Through Me.&quot; The production is a little crazy and ambitious, unlike whatever I put out for 2008 which will be stripped down and subdued. But track one is really the first song I wrote that made me feel like I had something worthwhile to contribute to the world of musical expression.

These are the tracks that have been praised sporadically by fans. 


